import React,{useState} from 'react';
class Todo extends React.Component {
  state = {
    
    users: [],
  
  };

  fetchUsers() {
    fetch("https://api-nodejs-todolist.herokuapp.com/task",{
method:"GET",
headers:{
  "Authorization":"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJfaWQiOiI2MDA4Y2MzZTVhYjQ2ZjAwMTdiOGY2NGUiLCJpYXQiOjE2MTcxMDM5MDJ9.9djKES2nNL5AB503hu0t2NarPKiS5UQwTBOJbnEopws",
  "Content-Type":"application/json"
}

    })
      .then(response => response.json())
      .then(data =>
        this.setState({
          users: data,
        
        })
      )
     
  }

  componentDidMount() {
    this.fetchUsers();
  }
  render() {
    const {users} = this.state;
    return (
      <React.Fragment>
        <h1>Random User</h1>

        {
          Object.keys(users).map(user => {
            const { id, description } = user;
            return (
              <div key={id}>
                <p>Name: {description}</p>
          
                <hr />
              </div>
            );
          })
   
      }
      { console.log(users)}
      </React.Fragment>
    );
  }
}





class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = { users: [] };
  }

  componentDidMount() {
    fetch("https://api-nodejs-todolist.herokuapp.com/task",{
      method:"GET",
      headers:{
        "Authorization":"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJfaWQiOiI2MDA4Y2MzZTVhYjQ2ZjAwMTdiOGY2NGUiLCJpYXQiOjE2MTcxMDM5MDJ9.9djKES2nNL5AB503hu0t2NarPKiS5UQwTBOJbnEopws",
        "Content-Type":"application/json"
      }
      
          })
      .then(response => response.json())
      .then(data => {
        const data2 = data.results;
        this.setState({ users: data2 });
      });
  }

  render() {
    console.log(this.state.users);

    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Floyd's API Call</h1>
          <a href src={"https://ford.com"}>dd</a>
        </header>
        <div class="table-responsive">
          <table className="table">
            <thead>
              <tr>
                <th>Firstname</th>
                <th>UserName</th>
                <th>Email</th>
                <th>Phone</th>
                <th>state</th>
              </tr>
            </thead>
            {this.state.users.map(user => {
              return (
                <tbody>
                  <tr key={user.id.value}>
                    <td>{user.name.first}</td>
                    <td>{user.login.username}</td>
                    <td>{user.email}</td>
                    <td>{user.phone}</td>
                    <td>{user.location.street}</td>
                  </tr>
                </tbody>
              );
            })}
          </table>
        </div>
      </div>
    );
  }
}




export default Todo
